import React from 'react';
import { connect } from 'react-redux';
import { Link, RouteComponentProps } from 'react-router-dom';
import { Button, Col, Row, Table } from 'reactstrap';
// tslint:disable-next-line:no-unused-variable
import { Translate, ICrudGetAllAction } from 'react-jhipster';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import { IRootState } from 'app/shared/reducers';
import { getEntities } from './sede.reducer';
import { ISede } from 'app/shared/model/sede.model';
// tslint:disable-next-line:no-unused-variable
import { APP_DATE_FORMAT, APP_LOCAL_DATE_FORMAT } from 'app/config/constants';

export interface ISedeProps extends StateProps, DispatchProps, RouteComponentProps<{ url: string }> {}

export class Sede extends React.Component<ISedeProps> {
  componentDidMount() {
    this.props.getEntities();
  }

  render() {
    const { sedeList, match } = this.props;
    return (
      <div>
        <h2 id="sede-heading">
          <Translate contentKey="ghostceetApp.sede.home.title">Sedes</Translate>
          <Link to={`${match.url}/new`} className="btn btn-primary float-right jh-create-entity" id="jh-create-entity">
            <FontAwesomeIcon icon="plus" />
            &nbsp;
            <Translate contentKey="ghostceetApp.sede.home.createLabel">Create new Sede</Translate>
          </Link>
        </h2>
        <div className="table-responsive">
          <Table responsive>
            <thead>
              <tr>
                <th>
                  <Translate contentKey="global.field.id">ID</Translate>
                </th>
                <th>
                  <Translate contentKey="ghostceetApp.sede.nombreSede">Nombre Sede</Translate>
                </th>
                <th>
                  <Translate contentKey="ghostceetApp.sede.direccion">Direccion</Translate>
                </th>
                <th>
                  <Translate contentKey="ghostceetApp.sede.estado">Estado</Translate>
                </th>
                <th />
              </tr>
            </thead>
            <tbody>
              {sedeList.map((sede, i) => (
                <tr key={`entity-${i}`}>
                  <td>
                    <Button tag={Link} to={`${match.url}/${sede.id}`} color="link" size="sm">
                      {sede.id}
                    </Button>
                  </td>
                  <td>{sede.nombreSede}</td>
                  <td>{sede.direccion}</td>
                  <td>
                    <Translate contentKey={`ghostceetApp.Estado.${sede.estado}`} />
                  </td>
                  <td className="text-right">
                    <div className="btn-group flex-btn-group-container">
                      <Button tag={Link} to={`${match.url}/${sede.id}`} color="info" size="sm">
                        <FontAwesomeIcon icon="eye" />{' '}
                        <span className="d-none d-md-inline">
                          <Translate contentKey="entity.action.view">View</Translate>
                        </span>
                      </Button>
                      <Button tag={Link} to={`${match.url}/${sede.id}/edit`} color="primary" size="sm">
                        <FontAwesomeIcon icon="pencil-alt" />{' '}
                        <span className="d-none d-md-inline">
                          <Translate contentKey="entity.action.edit">Edit</Translate>
                        </span>
                      </Button>
                      <Button tag={Link} to={`${match.url}/${sede.id}/delete`} color="danger" size="sm">
                        <FontAwesomeIcon icon="trash" />{' '}
                        <span className="d-none d-md-inline">
                          <Translate contentKey="entity.action.delete">Delete</Translate>
                        </span>
                      </Button>
                    </div>
                  </td>
                </tr>
              ))}
            </tbody>
          </Table>
        </div>
      </div>
    );
  }
}

const mapStateToProps = ({ sede }: IRootState) => ({
  sedeList: sede.entities
});

const mapDispatchToProps = {
  getEntities
};

type StateProps = ReturnType<typeof mapStateToProps>;
type DispatchProps = typeof mapDispatchToProps;

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Sede);
